import { Component } from '@angular/core';

@Component({
  selector: 'app-search-flights',
  templateUrl: './search-flights.component.html',
  styleUrls: ['./search-flights.component.css']
})
export class SearchFlightsComponent {

  searchResult: FlightRm[] = [
    {
      airline: "American Airlines",
      remainingNumberOfSeats: 500,
      departure: { time: Date.now().toString(), place: "Los Angeles" },
      arrival: { time: Date.now.toString(), place: "Istanbul" },
      price: "350",
    },
    {
      airline: "Thai Airways",
      remainingNumberOfSeats: 300,
      departure: { time: Date.now().toString(), place: "StockHolm" },
      arrival: { time: Date.now.toString(), place: "Bangkok" },
      price: "620",
    },
    {
      airline: "British Airways",
      remainingNumberOfSeats: 400,
      departure: { time: Date.now().toString(), place: "Helsinki" },
      arrival: { time: Date.now.toString(), place: "London" },
      price: "179",
    },
    {
      airline: "Lufthansa",
      remainingNumberOfSeats: 180,
      departure: { time: Date.now().toString(), place: "Copenhagen" },
      arrival: { time: Date.now.toString(), place: "Berlin" },
      price: "119",
    },
  ];
 

  constructor() { }

}

export interface FlightRm {
  airline: string;
  arrival: TimePlaceRm;
  departure: TimePlaceRm;
  price: string;
  remainingNumberOfSeats: number;
}

export interface TimePlaceRm {
  place: string;
  time: string;

}
